    function makeDraggable(element, handle) {
        let startX = 0;
        let startY = 0;
        let initialLeft = 0;
        let initialTop = 0;

        const savedTop = GM_getValue('meow_ui_top');
        const savedLeft = GM_getValue('meow_ui_left');
        if (savedTop && savedLeft) {
            element.style.top = savedTop;
            element.style.left = savedLeft;
            element.style.right = 'auto';
        }

        handle.onmousedown = dragMouseDown;

        function dragMouseDown(e) {
            e = e || window.event;
            e.preventDefault();
            startX = e.clientX;
            startY = e.clientY;
            initialLeft = element.offsetLeft;
            initialTop = element.offsetTop;
            element.style.transition = 'none';
            element.style.opacity = '0.9';
            element.style.cursor = 'grabbing';
            document.onmouseup = closeDragElement;
            document.onmousemove = elementDrag;
        }

        function elementDrag(e) {
            e = e || window.event;
            e.preventDefault();
            const deltaX = e.clientX - startX;
            const deltaY = e.clientY - startY;
            let newLeft = initialLeft + deltaX;
            let newTop = initialTop + deltaY;
            const maxLeft = window.innerWidth - element.offsetWidth;
            const maxTop = window.innerHeight - element.offsetHeight;
            if (newLeft < 0) newLeft = 0;
            if (newTop < 0) newTop = 0;
            if (newLeft > maxLeft) newLeft = maxLeft;
            if (newTop > maxTop) newTop = maxTop;
            element.style.left = newLeft + "px";
            element.style.top = newTop + "px";
            element.style.right = 'auto';
        }

        function closeDragElement() {
            document.onmouseup = null;
            document.onmousemove = null;
            element.style.transition = 'all 0.3s cubic-bezier(0.68, -0.55, 0.27, 1.55)';
            element.style.opacity = '1';
            element.style.cursor = 'default';
            GM_setValue('meow_ui_top', element.style.top);
            GM_setValue('meow_ui_left', element.style.left);
        }
    }

