    const lastPath = window.location.pathname.split('/').pop();
    const getUrlParams = (name) => new URLSearchParams(window.location.search).get(name);
    const customQuerySelector = (sel) => document.querySelectorAll(sel)[0];
    const uiStyle = 'position:fixed; top:60px; right:20px; z-index:999999; display:flex; flex-direction:column; gap:8px; background:rgba(30, 30, 30, 0.95); padding:12px; border-radius:16px; border:2px solid #FFB74D; width: 180px; transition: all 0.3s cubic-bezier(0.68, -0.55, 0.27, 1.55);';
    const titleStyle = 'color:#FFB74D; font-weight:bold; font-size:13px; display:flex; justify-content:space-between; align-items:center; border-bottom:2px dashed #FFB74D; padding-bottom:8px; margin-bottom:5px; cursor: move; user-select: none;';
    const statusStyle = 'color:#81D4FA; font-size:12px; font-weight:bold; text-align:center; font-family: sans-serif;';
    const versionText = 'v1.2.4';
    const versionStyle = 'color:#FFB74D; font-size:10px; opacity: 0.7; text-align: right; margin-top: 5px;';
    const examId = `${getUrlParams('course_id')}_${getUrlParams('paper_id')}`;
    const channelName = `NoMoreExam_${examId}`;

    const triggerMobileClick = (el) => {
        if (!el) return;
        el.scrollIntoView({block: "center", inline: "nearest"});
        el.click();
        const touchEnd = new Event('touchend', { bubbles: true, cancelable: true });
        const touchStart = new Event('touchstart', { bubbles: true, cancelable: true });
        el.dispatchEvent(touchStart);
        el.dispatchEvent(touchEnd);
    };

    function sendMessageToOtherTab(msg) { const c = new BroadcastChannel(channelName); c.postMessage(msg); }
    function setupMessageListener(h) { const c = new BroadcastChannel(channelName); c.onmessage = (e) => h(e.data); }

    const formatTime = (seconds) => {
        if (seconds < 0) return '0秒';
        const h = Math.floor(seconds / 3600);
        const m = Math.floor((seconds % 3600) / 60);
        const s = Math.floor(seconds % 60);
        let str = '';
        if (h > 0) str += h + '时';
        if (m > 0) str += m + '分';
        str += s + '秒';
        return str;
    };

    function checkPendingExamIndependent() {
        const activeItem = document.querySelector('li.active');
        if (activeItem) {
            const text = activeItem.innerText;
            if (text.includes('待考试') || text.includes('已完成') || text.includes('已学') || text.includes('考试通过')) {
                let examBtn = null;
                const allBtns = document.querySelectorAll('button, a, .btn, span');
                for (let btn of allBtns) {
                    if (btn.offsetParent === null) continue;
                    const btnText = btn.innerText.replace(/\s/g, '');
                    if (['本节考试', '本次考试', '进入考试', '参加考试', '课后考核', '课后作业'].includes(btnText)) {
                        if(btn.href && btn.href.includes('javascript:void(0)')) { examBtn = btn; break; }
                        if(btn.onclick) { examBtn = btn; break; }
                        if(btn.tagName === 'A' && btn.href && !btn.href.includes('#')) { examBtn = btn; break; }
                        if(btn.tagName === 'BUTTON') { examBtn = btn; break; }
                    }
                }
                if (examBtn) {
                    const uiStatus = document.querySelector('.meow-ui-status');
                    if(uiStatus) uiStatus.innerText = "⚡ 检测到补考，秒进...";
                    const v = document.querySelector('video');
                    if(v) v.pause();
                    examBtn.click();
                    return true;
                }
            }
        }
        return false;
    }
